import React from 'react'
import LoginForm from '../components/LoginForm';

const Home = () =>{

    return(
        <div className="home">
            <video style={{width:'100%',height:'100%',position:'fixed',zIndex:-1,objectFit:'cover'}} autoPlay muted loop>
                <source src="video/aa.mp4" type="video/mp4" />
            </video>

            <div className="loginForm" style={{backgroundColor:'white',maxWidth:'350px',height:'500px',opacity:'0.8'}} >
                <LoginForm />
            </div>

            {/* <img src="/static/123.png"/> */}
        </div>
    )
}

export default Home;
